import React from 'react';
import Card from './card';
import Jumbotron from './jumbotron'

const App =()=>{
    return(
        <div className='ui container'style={{marginTop:'10px'}}>
          <div className='col-sm-6'>
            <Card />
            </div>
            <div className='col-sm-6'>
            <Jumbotron />
            </div>
        </div>
    )
}

export default App;
